import React, { Component } from "react";
import Fade from "react-slideshow-image/lib/components/slideshow/fade";
import lehigh1 from "../images/lehigh-1.png";
import lehigh2 from "../images/lehigh-4.png";
import lehigh3 from "../images/lehigh-5.png";

const slideProperties = {
  duration: 5000,
  transitionDuration: 2000,
  infinite: true,
  indicators: true,
  arrows: true
};

class Education extends Component {
  state = {
    slideImages: [
      { id: 1, value: lehigh1 },
      { id: 2, value: lehigh2 },
      { id: 3, value: lehigh3 }
    ]
  };

  render() {
    return (
      <div className="education-container">
        <div className="education">
          <div className="slide-container">
            <Fade {...slideProperties}>
              {this.state.slideImages.map(slide => (
                <div key={slide.id} className="each-fade">
                  <img
                    className="lehigh-photo"
                    src={slide.value}
                    alt="Lehigh University"
                  />
                </div>
              ))}
            </Fade>
          </div>
          <div className="lehigh-text-container">
            <h3 className="lehigh-name">LEHIGH UNIVSERSITY | 2006 - 2010</h3>
            <h3 className="lehigh-address">
              27 Memorial Dr W, Bethlehem, PA 18015
            </h3>
            <br />
            <p className="lehigh-degree">
              Bachelor of Science; <b>Finance</b> | <i>Minor in Psychology</i>
            </p>
          </div>
        </div>
      </div>
    );
  }
}

export default Education;
